const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher CLI(命令行界面)是一个命令行工具，可用于与 Rancher 进行交互。`}</p>
    <h2 {...{
      "id": "下载-rancher-cli"
    }}>{`下载 Rancher CLI`}</h2>
    <p>{`Rancher 提供了 Windows、Mac 和 Linux 的 Rancher CLI 二进制文件下载链接，该链接位于 Rancher UI 的右下角，单击链接可以下载 Rancher CLI 二进制文件。除此之外，您还可以访问 Rancher 的 GitHub 页面，导航到`}<a parentName="p" {...{
        "href": "https://github.com/rancher/cli/releases"
      }}>{`CLI 发行页面`}</a>{`，下载该二进制文件。`}</p>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`提示`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`国内用户，可以导航到 `}<a parentName="p" {...{
            "href": "http://mirror.cnrancher.com"
          }}>{`http://mirror.cnrancher.com`}</a>{` 下载所需资源`}</p></div></div>
    <h2 {...{
      "id": "要求"
    }}>{`要求`}</h2>
    <p>{`下载 Rancher CLI 后，需要配置一些参数：`}</p>
    <ul>
      <li parentName="ul">{`您的`}<a parentName="li" {...{
          "href": "/docs/rancher2/admin-settings/_index"
        }}>{`Rancher Server URL`}</a>{`，用于连接到 Rancher Server。`}</li>
      <li parentName="ul">{`API Bearer Token，用于与 Rancher 进行身份验证。有关获取 Bearer Token 的更多信息，请参见`}<a parentName="li" {...{
          "href": "/docs/rancher2/user-settings/api-keys/_index"
        }}>{`创建 API 密钥`}</a>{`。`}</li>
    </ul>
    <h2 {...{
      "id": "cli-认证"
    }}>{`CLI 认证`}</h2>
    <p>{`在使用 Rancher CLI 控制 Rancher Server 之前，必须使用 API​​ Bearer Token 进行身份验证。使用以下命令登录(用您的信息替换 `}<inlineCode parentName="p">{`<BEARER_TOKEN>`}</inlineCode>{` 和 `}<inlineCode parentName="p">{`<SERVER_URL>`}</inlineCode>{` )：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`$ ./rancher login https://<SERVER_URL> --token <BEARER_TOKEN>
`}</code></pre>
    <p>{`如果您的 Rancher Server 使用的是自签名证书，则 Rancher CLI 会询问您是否继续连接。`}</p>
    <h2 {...{
      "id": "选择项目"
    }}>{`选择项目`}</h2>
    <p>{`在执行任何命令之前，必须选择一个 Rancher 项目(Project)来对其执行命令。要选择要运行的`}<a parentName="p" {...{
        "href": "/docs/rancher2/cluster-admin/projects-and-namespaces/_index"
      }}>{`项目`}</a>{`，请使用命令 `}<inlineCode parentName="p">{`./rancher context switch`}</inlineCode>{` 切换或选择项目。输入此命令时，将显示可用项目的列表。输入数字以选择您的项目。`}</p>
    <p>{`例如： `}<inlineCode parentName="p">{`./rancher context switch`}</inlineCode>{` 输出`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`User:rancher-cli-directory user$ ./rancher context switch
NUMBER    CLUSTER NAME   PROJECT ID              PROJECT NAME
1         cluster-2      c-7q96s:p-h4tmb         project-2
2         cluster-2      c-7q96s:project-j6z6d   Default
3         cluster-1      c-lchzv:p-xbpdt         project-1
4         cluster-1      c-lchzv:project-s2mch   Default
Select a Project:
`}</code></pre>
    <p>{`输入数字“3”，单击回车键，控制台会显示两条消息，第一条说明您已切换到项目`}<inlineCode parentName="p">{`project-1`}</inlineCode>{`，第二条说明修改`}<inlineCode parentName="p">{`project-1`}</inlineCode>{`参数后，这些改动会被保存到`}<inlineCode parentName="p">{`/Users/markbishop/.rancher`}</inlineCode>{`路径下的`}<inlineCode parentName="p">{`cli2.json`}</inlineCode>{`文件中。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`INFO[0005] Setting new context to project project-1
INFO[0005] Saving config to /Users/markbishop/.rancher/cli2.json
`}</code></pre>
    <h2 {...{
      "id": "指令列表"
    }}>{`指令列表`}</h2>
    <p>{`以下指令可在 Rancher CLI 中使用。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`指令`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`作用`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`apps, [app]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对应用商店 App 执行操作 (例如，单个`}<a parentName="td" {...{
              "href": "https://helm.sh/docs/"
            }}>{`Helm charts`}</a>{` 或 `}<a parentName="td" {...{
              "href": "/docs/rancher2/helm-charts/legacy-catalogs/adding-catalogs/_index"
            }}>{`Rancher charts`}</a>{`)。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`catalog`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对`}<a parentName="td" {...{
              "href": "/docs/rancher2/helm-charts/legacy-catalogs/_index"
            }}>{`应用商店`}</a>{`执行操作。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`clusters, [cluster]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对您的`}<a parentName="td" {...{
              "href": "/docs/rancher2/cluster-provisioning/_index"
            }}>{`集群`}</a>{`执行操作。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`context`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`在 Rancher 的`}<a parentName="td" {...{
              "href": "/docs/rancher2/cluster-admin/projects-and-namespaces/_index"
            }}>{`项目`}</a>{`间切换。请看示例`}<a parentName="td" {...{
              "href": "#%E9%80%89%E6%8B%A9%E9%A1%B9%E7%9B%AE"
            }}>{`选择项目`}</a>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`inspect [OPTIONS] [RESOURCEID RESOURCENAME]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`显示有关`}<a parentName="td" {...{
              "href": "https://kubernetes.io/docs/reference/kubectl/cheatsheet/#resource-types"
            }}>{`Kubernetes 资源`}</a>{`或 Rancher 资源(例如：`}<a parentName="td" {...{
              "href": "/docs/rancher2/cluster-admin/projects-and-namespaces/_index"
            }}>{`项目`}</a>{`和`}<a parentName="td" {...{
              "href": "/docs/rancher2/k8s-in-rancher/workloads/_index"
            }}>{`工作负载`}</a>{`)的详细信息，通过名称或 ID 指定资源。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`kubectl`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`执行`}<a parentName="td" {...{
              "href": "https://kubernetes.io/docs/reference/kubectl/overview/#operations"
            }}>{`kubectl 指令`}</a>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`login, [l]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`登录进一个 Rancher Server。例如：`}<a parentName="td" {...{
              "href": "#cli%E8%AE%A4%E8%AF%81"
            }}>{`CLI 认证`}</a>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`namespaces, [namespace]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对`}<a parentName="td" {...{
              "href": "/docs/rancher2/cluster-admin/projects-and-namespaces/_index"
            }}>{`命名空间`}</a>{`执行操作。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`nodes, [node]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对`}<a parentName="td" {...{
              "href": "/docs/rancher2/overview/concepts/_index"
            }}>{`节点`}</a>{`执行操作。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`projects, [project]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`对`}<a parentName="td" {...{
              "href": "/docs/rancher2/cluster-admin/projects-and-namespaces/_index"
            }}>{`项目`}</a>{`执行操作。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`ps`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`显示项目中的`}<a parentName="td" {...{
              "href": "/docs/rancher2/k8s-in-rancher/workloads/_index"
            }}>{`工作负载`}</a>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`settings, [setting]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`显示当前 Rancher Server 的设置。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`ssh`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`使用 SSH 协议连接到集群里的节点。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`help, [h]`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`显示命令列表或某个命令的帮助信息。`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "rancher-cli-帮助命令"
    }}>{`Rancher CLI 帮助命令`}</h2>
    <p>{`使用 CLI 登录到 Rancher Server 后，输入 `}<inlineCode parentName="p">{`./rancher --help`}</inlineCode>{` 可以查看可用的命令列表。`}</p>
    <p>{`所有命令都接受 `}<inlineCode parentName="p">{`--help`}</inlineCode>{` 参数，可以通过该参数查看每个命令行的用法。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
